      var loadPhrase = function(file,speed){
        
        
        
        var url = 'https://s3.amazonaws.com/lc-gov-audio/phrases/' + file
        var speedMS = 0;
        if (speed == 'fast'){
          speedMS = 500
        }
        if (speed == 'slow'){
          speedMS = 1000
        }
        
        var add = function(json){
          let c = 0
          let start = 0
          json.forEach((j)=>{
            start=start+speedMS;             
            j.id = c;
            // (function(){
              let p = new Audio("data:audio/wav;base64," + j.mp3);
              // p.play()
              // p.pause()
              playIndex[c] = j
              timeOutStore.push(setTimeout(function(){              
                addText(j,'inline');   
                if (muteNow){
                  return
                }                
                p.play();
              },start));   
            // })()
            c++
          })         
        }
        
        
        
        
        
        if (hasInteracted){
          fetch(url)
            .then(function(response) {
              return response.json();
            })
            .then(function(json) {
              add(json); 
            }).catch(function(error) {
              console.log(error);
            });              
        }else{

          var playButton = document.createElement('button')
          playButton.innerText = 'Click to Play Audio';
          playButton.style.fontSize = '5em';
          playButton.classList.add('button-outline')
          inlineDiv.appendChild(playButton)

          
          fetch(url)
            .then(function(response) {
              return response.json();
            })
            .then(function(json) {
            playButton.addEventListener('click', function(event){              
              inlineDiv.innerHTML="";
              add(json);              
            });         
            
            }).catch(function(error) {
              console.log(error);
            });                 
          
        }
        
      }
      
      
      var randomSpeed = function(){
         
        var r = Math.floor(Math.random() * Math.floor(3));
        
        if (r===0){
          return 'unison' 
        }else if (r===1){
          return 'fast' 
        }else{
          return 'slow' 
        }
        
      }

